import React from 'react';
import {Nav, Navbar} from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

import styles from './sidebar.css';


const Sidebar = () => {
    return (
        <div id="sidebar-menu" className={styles.sideBarMenuContainer}>
            <Navbar fluid className={styles.sidebar} inverse>
                <Navbar.Toggle />
                <Navbar.Brand>
                    <NavLink href="/">User Name</NavLink>
                </Navbar.Brand>

                <Navbar.Collapse>
                    <Nav>
                        <NavLink className="nav-link" to={'about'}>About</NavLink>
                        <NavLink className="nav-link" to={'experience'}>Experience</NavLink>
                        <NavLink className="nav-link" to={'education'}>Education</NavLink>
                        <NavLink className="nav-link" to={'skills'}>Skills</NavLink>
                        <NavLink className="nav-link" to={'interests'}>Interests</NavLink>
                    </Nav>
                </Navbar.Collapse>
            </Navbar>
        </div>
    );
}

export default Sidebar;
